import React from "react";
import {
  StyleSheet,
  Text,
  View,
  TextInput,
  TouchableOpacity,
} from "react-native";

import { styles } from "../style/style";

export default function Products(navigation, routes) {
  let auth = routes.auth;
  let user = routes.user;

  if (auth && user) {
    console.log(`${auth} ${user}`);
    return (
      <View style={styles.container}>
        <Text style={styles.title}>Products by {user.name}</Text>
        <Text style={styles.subtitle}>Auth {auth}</Text>
      </View>
    );
  } else {
    navigation.navigate("Signin");
  }
}
